INSERT INTO `messages` VALUES (1,1,2,'Hi!',1,'2022-03-29 20:09:59','2022-03-29 20:09:59'),(2,1,2,'Vasya!',1,'2022-03-29 20:09:59','2022-03-29 20:09:59'),(3,2,1,'Hi, Petya',1,'2022-03-29 20:10:00','2022-03-29 20:10:00'),(53,27,30,'На улице у программиста спрашивают: Скажите, который час? \"Который час\", если Вас это так прикалвает…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(54,1,13,'Идёт первая русско-украинская война в интернете. Убитых нет, но много раненых в голову.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(55,41,47,'Tation delenit percipitur at vix. Nisl omittam complectitur pro an, quem omnes munere id vix.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(56,34,20,'С другой стороны укрепление и развитие структуры обеспечивает участие в формировании систем массового участия.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(57,10,38,'У нас в офисе кофеварку мощную установили, встроенную в шкаф. Кнопок на ней столько — я пока себе капучино делал, похоже, сайт Пентагона взломал.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(58,2,36,'Работа программиста и шамана имеет много общего - оба бормочут непонятные слова, совершают непонятные действия и не могут объяснить, как это работает.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(59,49,23,'Задача, которую программист решит мгновенно и от которой у физика случиться нервный тик: Ася весит 14,5 метра. За какое время она скачается, если ширина канала 512 кило?',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(60,47,25,'У вас интернет-зависимость со всеми вытекающими последствиями, если при словах десять тысяч копий, вы представляете что угодно, только не войско Александра Македонского.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(61,19,19,'Внимание!!! Мы должны убедиться, что сайтом пользуется не робот!!! Для этого разденьтесь догола и включите wеb-камеру…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(62,21,46,'На список сайтов, заблокированных Роскомнадзором, смотрю как на рекламную витрину книжной лавки: \"Так, что бы сегодня из новинок почитать? Ага, вот это возьму\".',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(63,24,36,'Хорошо когда ты отдохнул на природе. Хуже, когда природа отдохнула на тебе…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(64,44,4,'Из комбинации лени и логики получаются программисты.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(65,14,44,'Предложила ему чай с тортом, а он на грудь смотрит...Может, молока хочет?',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(66,21,7,'Будни сайта знакомств: — Виртуальный олигарх из Лондона оказался реальным пацаном с Троещины.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(67,36,10,'Сайт, который можно сделать за две недели, мы делали три месяца. Потому что нельзя ничего сделать за две недели.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(68,13,49,'Чем отличается программист от политика? — Программисту платят деньги за работающие программы.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(69,11,20,'Работа программиста и шамана имеет много общего - оба бормочут непонятные слова, совершают непонятные действия и не могут объяснить, как это работает.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(70,7,36,'Из форума программистов: — Помогитенеработаетпробел!!! — Настоящие_программисты_пробелами_не_пользуются',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(71,38,12,'Нет повести печальнее на свете, чем повесть о лимитном интернете…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(72,39,7,'Как вызвать в стране революцию? Элементарно! Отключите интернет и миллионы возмущенных пользователей вывалят на улицу',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(73,1,29,'Два русских сувенира - матрешка и водка - удивительно похожи: открываешь первую, а там и вторая, третья, четвертая..',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(74,6,22,'Вчера отключили свет… Два часа провел без Интернета… Пообщался со своей семьей, оказывается, — очень приятные люди!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(75,15,4,'Плохо без девчонок - это ещё хорошо. Вот когда хорошо без девчонок - это уже плохо…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(76,35,50,'Чебурашка - это слишком официально и длинно. Зовите меня просто - Че!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(77,6,21,'Мне родители говорили, что меня в капусте нашли. Я своим детям скажу, что я их с интернета скачала.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(78,7,1,'Почувствовала себя настоящей женщиной, когда просидела 4 часа в аське, дожидаясь пока Он будет онлайн и напишет \"Привет\", чтобы сообщить ему, что я с ним не разговариваю.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(79,20,46,'Внимание!!! Мы должны убедиться, что сайтом пользуется не робот!!! Для этого разденьтесь догола и включите wеb-камеру…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(80,1,18,'Для программиста монитор — это реальный рабочий стол, системный блок — журнальный, а клавиатура — обеденный.',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(81,15,7,'— Ой, извините, но по сайту знакомств я Вас себе не такой представлял — Да Вы пейте, пейте!!!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(82,34,6,'Отец — сыну: — Слушай, почему всякий раз когда попользуешься интернетом ты подцепляешь вирус, в то время как я сколько пользовался и не разу не подцеплял?? — А это потому что ты старенький, и не знаешь на каких сайтах их нужно подцеплять!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(83,28,42,'Что делает программист после запоя наутро? — Тестирует память.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(84,27,19,'Я просто предложил ей кофе, а увидел в её глазах секс, ЗАГс, двоих детей, ипотеку, трёх внуков и стакан воды.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(85,28,45,'Можно ли загадать желание, если сидишь между двумя программистами? — Можно! Только глючить будет.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(86,38,42,'Вчера хотели сократить, но услышав крик «ура! наконец-то!.. а покажите лoхa, который на мою работу согласился?», начальник передумал…',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(87,5,37,'Люди!!! Не пользуйтесь Интернетом! Вас обманут! Не верите? Переверните аббревиатуру WWW вверх ногами!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(88,41,20,'Сара на сайте знакомств: — Не буду писать в статусе, что муж уехал в командировку и что я одна дома! А то ещё всякие мужики придут на улицу Ришелье, д. 15, кв. 22 (3 подъезд), а дверь не заперта…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(89,16,29,'Сын спрашывает отца-программиста: --Папа, а откуда дети берутся? --Отстань сынок,сынок,спроси у \"Яндекса\"…',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(90,6,5,'Переполнилась чаша терпения? Не парься — Купи ВЕДРО!',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(91,34,47,'Семья программистов. — Зайди сюда! — Куда, нет ссылки?! — НА КУХНЮ ЗАЙДИ!!!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(92,18,29,'Тонет программист. И во все горло орет: — F1, F1, F1, тьфу ты, помогите, помогите, помогите!!!',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(93,14,46,'Интернет - это продвинутая версия буддизма, он обеспечивает верующему в него человеку возможность прожить множество жизней и при этом все одновременно под разными никами.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(94,8,50,'Вебмастер сдает на права, заполняет бланк: Рост: 185 Вес: 90 Цвет глаз: #44AAFF',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(95,36,10,'Газета — уникальная вещь: она же и скатерть, и мухобойка, и вентилятор, и туалетная бумага, и шапка, и даже зонтик.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(96,17,24,'Заходит программист и вспоминает, что ему нужно попасть на 12ый этаж. Ну что делать? Ну, нажимает он \"1\", нажимает \"2\" и начинает судорожно искать клавишу Enter.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(97,22,3,'Блондинка пишет на сайт знакомств: — Я высокая, стройная, красивая. Люблю прыгать, кататься и смеяться. Нужен батут, шофер и клоун.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(98,10,9,'Задача, которую программист решит мгновенно и от которой у физика случиться нервный тик: Ася весит 14,5 метра. За какое время она скачается, если ширина канала 512 кило?',1,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(99,8,26,'К сожалению, с каждым годом всё чаще \"друг\" — это просто маленькая иконка на сайте социальной сети.',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(100,16,28,'Кольщик, наколи мне веб-дизайн. Рядом блок контактов с телефонами. Чтобы вдруг конверсия пошла. С предзаказами и перезвонами.',0,'2022-04-01 00:45:14','2022-04-01 00:45:14'),(101,47,14,'У нас в офисе кофеварку мощную установили, встроенную в шкаф. Кнопок на ней столько — я пока себе капучино делал, похоже, сайт Пентагона взломал.',1,'2022-04-01 00:45:14','2022-04-01 00:45:14');
